import React from 'react'
import PropTypes from 'prop-types';

const Movie = (props) => {
    const { title } = props;

    return (
        <>
            <img url=""> </img>
            <div>{title}</div>
        </>
    )
}

Movie.propTypes = {
    title: PropTypes.string.isRequired,
    img_url: PropTypes.string
}

export default Movie;
